import image2 from '../assets/wc2.png';
import image3 from '../assets/wc3.png';
import image4 from '../assets/wc4.png';


const Home = () => {
    return (
        <div className='homePage'>
            <h4>Three Pillars Promotions presents</h4>
            <h1>Warrior's Cup</h1>
            <h5>The home of East Coast Muay Thai</h5>
            <div className='imgCarousel'>
                 <div className="slider">
                    <img id="slide-1" src={image4} alt="img1" />
                    <img id="slide-2" src={image2} alt="img2" />
                    <img id="slide-3" src={image3} alt="img3" />
                    <img id="slide-4" src={image1} alt="img4" />
                </div>
            </div>
        </div>
    )
}

export default Home
